import React, { useEffect, useState } from "react";
import { Form, Modal, Button } from "react-bootstrap";

function ManufacturerModal() {
  const [show, setShow] = useState(false);
  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  const radios = [
    { name: "Peugeot", value: "Peugeot" },
    { name: "Bar", value: "bar" },
    { name: "Baz", value: "baz" }
  ];

  return (
    <>
    <button type="button" class="btn btn-outline-secondary btn-sm px-4" onClick={handleShow}>Pokreni konfigurator</button>

      <Modal show={show} onHide={handleClose} backdrop="static" keyboard={false}>
        <Modal.Header closeButton>
          <Modal.Title>Konfigurator servisa</Modal.Title>
        </Modal.Header>
        <Modal.Body>
        <Form>
        <InputGroup>
  <InputGroup.Radio value="1" name="test" aria-label="Radio 1" />some text
  <InputGroup.Radio value="2" name="test" aria-label="Radio 2" />or this text
  <InputGroup.Radio value="3" name="test" aria-label="Radio 3" />no, that text
</InputGroup>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>Next</Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default ManufacturerModal;
